function App() {

    React.useEffect(() => {
        fetch("/api")
            .then((res) => res.json())
            .then((data) => setData(data.message));
    }, []);
  return (
    <div className="App">
      <h1>Login Page</h1>
    </div>
  );
}

export default App;
